
def polymers(string):
    start = 0;
    while(True):
        check = False;
        for a in range(start, len(string) - 1):
            #print(a);
            uniCode = ord(string[a]);
            uniCodeOfNext = ord(string[a+1]);
            if(abs(uniCode - uniCodeOfNext) == 32):
                check = True;
                if (a+2 > len(string)):
                    string = (string[:a]);
                    start -= 1;
                else:
                    string = (string[:a] + string[a+2:]);
                    start -= 1;
                break;
            start += 1;
        if check == False:
            return len(string);
    






print(polymers(""));